import React from 'react';

const VideoList = (props) => {
  console.log(props);
  console.log(props.length);
  const videos = props.videos.map((video) => {
    return (
      <iframe
        width="420"
        height="315"
        src={
          `https://www.youtube.com/embed/` + video.id.videoId
        }></iframe>
      // <video key={video.id.videoId} width="320" height="180" controls>
      //   <source
      //     src={`https://www.youtube.com/watch?v=` + video.id.videoId}
      //     type="video/mp4"
      //   />
      //   <source
      //     src={`https://www.youtube.com/watch?v=` + video.id.videoId}
      //     type="video/ogg"
      //   />
      // </video>
    );
  });
  return <div>{videos}</div>;
};

export default VideoList;
